const Header = (bgcolor,clr) => {
    const headerStyle={
        backgroundColor: bgcolor,
        color: clr,
    };
    console.log({bgcolor})
  return (
    <>
    <div className="container">
        <h2 style ={headerStyle}>FEEDBACK UI</h2>
    </div>
    </>
  )
}

Header.defaultProps  = {
    bgcolor:'green',
    clr:'red',
}

export default Header;
